import React from 'react'
import TodoItem from './Todo/TodoItem'

const styles = {
    ul: {
        listStyle: 'none',
        margin: 0,
        padding: 0
    }
}

export default function TodoList() {
    return (
        <ul style={styles.ul}>
            <li>Art</li>
            <li>Ko</li>
        </ul>)
}
